window.bookSummaryJSON = "<p><b>\"I don't need a line to know what is considered good or bad. But if I did, there isn't a line I wouldn't cross for you.\"</b></p> <p><b>Rennick</b></p> <p>When Rennick was thirteen, the gods bestowed upon him the name of his fated mate—a human girl. As the sole heir to the Mountain Kingdom, magic bound him to his kingdom until he ascended the throne on his twenty-fifth birthday. As a human, she couldn't cross the magical barrier separating the humans from the fae. Heartsore and consumed with thoughts of her, he did the only thing he could and sent her anonymous letters and gifts…</p> <p>Until he crossed the barrier into her kingdom to claim her as his own.</p> <p><b>Amelia</b></p> <p>Six months after Amelia's thirteenth birthday, she received a strange letter from a fae boy claiming her as his mate. Humans weren't taught much about the fae, and one look at the horrifying doll meant to be her belated birthday gift solidified her suspicions that someone was playing a cruel joke. Except the letters and odd gifts kept coming. Against her better judgment, Amelia fell in love with her mysterious admirer throughout the years, certain they would never meet. But on her twenty-fifth birthday, her walk to work was interrupted by two familiar words she'd read a million times.</p> <p>\"Hello, love.\"</p> <p>Viciously Yours <i>is a fast-paced new adult fantasy romance that focuses solely on the relationship between the two main characters. This is a romance book in a traditional fantasy setting with minimal world-building. It is book one in the Fae Kings of Eden series of interconnected standalones, that is best enjoyed in order.</i></p> <p><i>The male main character is obsessed with his mate and does a few morally black things to those he deems a threat to his relationship. There are no shades of grey. The couple has minor obstacles, but there is no miscommunication, third-act breakup, or cheating. For mature listeners.</i></p> <p><i>Narrated in duet style.</i></p>"; 
